/*!
 * Built with Duet Design System
 */
import { formatViolations, options as axeRunOptions, testWithAxe } from "../../utils/axe-core-utils";
describe("[a11y] duet-cookie-consent", () => {
    it("should render an accessible component", async () => {
        const result = await testWithAxe(`
        <duet-cookie-consent accessible-label="Hyväksyn evästeiden käytön">
          Käytämme evästeitä. Käyttämällä verkkosivujamme hyväksyt evästeiden käyton.
          <a href="#" target="_blank">Lue lisää <duet-visually-hidden>evästeistä</duet-visually-hidden></a>
        </duet-cookie-consent>
      `, axeRunOptions);
        expect(result).not.toBeNull();
        expect(formatViolations(result.violations)).toEqual([]);
    });
});
